import React, { useContext } from "react";
import { DarkModeContext } from "./DarkModeContext";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import AnimatedBackground from "./AnimatedBackground";
import TypingEffect from "react-typing-effect";
import { FaGithub, FaLinkedin, FaTwitter } from "react-icons/fa";

const Hero = () => {
  const { isDarkMode } = useContext(DarkModeContext);

  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 3000,
  };

  return (
    <section
      id="home"
      className={`min-h-screen flex items-center justify-center relative overflow-hidden ${
        isDarkMode
          ? "bg-gradient-to-br from-[#0a0a1a] via-[#1a1a2e] to-[#0a0a1a]"
          : "bg-gradient-to-r from-blue-50 to-purple-50"
      }`}
    >
      <AnimatedBackground />
      <div className="container mx-auto px-4 relative z-10">
        <div className="grid grid-cols-1 lg:grid-cols-2 gap-12 items-center">
          <div className="text-left space-y-6">
            <h2
              className={`text-xl ${
                isDarkMode ? "text-purple-400" : "text-blue-600"
              } code-text`}
              data-aos="fade-right"
              data-aos-duration="1000"
            >
              &lt;Hello World /&gt;
            </h2>
            <h1
              className={`text-5xl font-bold code-text ${
                isDarkMode ? "text-white" : "text-gray-800"
              }`}
              data-aos="zoom-in"
              data-aos-easing="ease-out-cubic"
              data-aos-duration="1000"
              data-aos-delay="200"
            >
              <TypingEffect
                text={["Hi, I'm Rohann Keerthy"]}
                speed={100}
                eraseDelay={500}
                typingDelay={500}
                cursorColor={isDarkMode ? "#4a1d96" : "#000000"}
              />
            </h1>
            <p
              className={`text-lg ${
                isDarkMode ? "text-gray-300" : "text-gray-600"
              }`}
              data-aos="fade-up"
              data-aos-delay="400"
            >
              A passionate Full Stack Developer with expertise in AI/ML and Cloud
              technologies. I love building innovative solutions that make a
              difference.
            </p>
            <div
              className="flex space-x-4"
              data-aos="fade-up"
              data-aos-delay="600"
            >
              <a
                href="https://github.com/yourusername"
                target="_blank"
                rel="noopener noreferrer"
                className={`p-3 rounded-full ${
                  isDarkMode
                    ? "bg-[#1a1a2e] text-white hover:bg-[#2a2a3e]"
                    : "bg-white text-gray-800 hover:bg-gray-100"
                } transition-all duration-300 hover:scale-110 hover:rotate-12 shadow-lg`}
              >
                <FaGithub size={24} />
              </a>
              <a
                href="https://linkedin.com/in/yourusername"
                target="_blank"
                rel="noopener noreferrer"
                className={`p-3 rounded-full ${
                  isDarkMode
                    ? "bg-[#1a1a2e] text-white hover:bg-[#2a2a3e]"
                    : "bg-white text-gray-800 hover:bg-gray-100"
                } transition-all duration-300 hover:scale-110 hover:rotate-12 shadow-lg`}
              >
                <FaLinkedin size={24} />
              </a>
              <a
                href="https://twitter.com/yourusername"
                target="_blank"
                rel="noopener noreferrer"
                className={`p-3 rounded-full ${
                  isDarkMode
                    ? "bg-[#1a1a2e] text-white hover:bg-[#2a2a3e]"
                    : "bg-white text-gray-800 hover:bg-gray-100"
                } transition-all duration-300 hover:scale-110 hover:rotate-12 shadow-lg`}
              >
                <FaTwitter size={24} />
              </a>
            </div>
            <div
              className={`mt-8 p-4 rounded-lg ${
                isDarkMode ? "bg-[#1a1a2e]/50" : "bg-white/50"
              } backdrop-blur-sm`}
              data-aos="fade-up"
              data-aos-delay="800"
            >
              <p className={`font-mono text-sm ${
                isDarkMode ? "text-purple-400" : "text-blue-600"
              }`}>
                <span className="text-gray-500">const</span>{" "}
                <span className="text-yellow-500">skills</span> = {"{"}
                <br />
                &nbsp;&nbsp;ai: ["Machine Learning", "Deep Learning", "NLP"],
                <br />
                &nbsp;&nbsp;fullstack: ["React", "Node.js", "Python"],
                <br />
                &nbsp;&nbsp;cloud: ["AWS", "Docker", "Kubernetes"]
                <br />
                {"}"}
              </p>
            </div>
          </div>
          <div
            className="relative"
            data-aos="fade-left"
            data-aos-duration="1000"
            data-aos-delay="400"
          >
            <div className={`absolute inset-0 bg-gradient-to-r ${
              isDarkMode ? "from-purple-500/20 to-blue-500/20" : "from-blue-500/10 to-purple-500/10"
            } rounded-full blur-3xl animate-pulse`} />
            <img
              src="/profile.jpg"
              alt="Rohann Keerthy"
              className="relative rounded-full w-80 h-80 object-cover mx-auto shadow-2xl hover:scale-105 transition-transform duration-300"
            />
          </div>
        </div>
      </div>
    </section>
  );
};

export default Hero;
